import React from "react";
import "./CharacterCard.css";

const CharacterCard = props => (
    <div className="card">
        <div>
            <span>
                {props.name}
            </span>
        </div>
        <div className="image-container">
            <img alt={props.name} src={props.image}/>
        </div>
    </div>
);

export default CharacterCard
